class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        if not s or not words: return []
        if len(s)==0: return []
        totalLength = 0
        for word in words:
            totalLength += len(word)
        if totalLength > len(s): return []

        ans = []
        for i in range(len(s)):
            if i + totalLength <= len(s):
                wordList = words[:]
                wordToCheck = s[i:i+totalLength]
                repeat = 0
                while wordList and repeat<len(words):
                    back = wordList[0]
                    if back == wordToCheck[:len(back)]:
                        wordList.remove(back)
                        wordToCheck = wordToCheck[len(back):]
                        repeat=0
                    else:
                        wordList.remove(back)
                        wordList.append(back)
                        repeat +=1
                if not wordList:
                    ans.append(i)       

        return ans
    
tests = []
